import React from "react";
import { Col, Row, Card } from "antd";

const Services = () => {
  return (
    <div
      style={{ display: "flex", justifyContent: "center", paddingTop: "4rem", backgroundColor:"#eee" }}
    >
      <div style={{width:"100%", maxWidth:"850px", display:"flex", alignItems:"center", flexDirection:"colon"}}>
        <h3>My Bookings</h3>
        <Row>
          <Col span={6}>
            <Card
              title="Default size card"
              extra={<a href="#">More</a>}
              style={{
                width: 300,
              }}
            >
              <p>Card content</p>
              <p>Card content</p>
              <p>Card content</p>
            </Card>
          </Col>
          <Col span={6}>col</Col>
          <Col span={6}>col</Col>
          <Col span={6}>col</Col>
        </Row>
      </div>
    </div>
  );
};

export default Services;
